import React, { useContext, useEffect, useState } from 'react';
import { DragDropContext, Droppable, Draggable } from 'react-beautiful-dnd';
import EventCard from './EventCard';
import Task from './Task'; // Import the Task component
import { v4 as uuidv4 } from 'uuid'; // Import uuid
import TaskContext from './TaskContext'; // Import TaskContext

const Dashboard = () => {
  const { tasks, setTasks, columnIds, setColumnIds } = useContext(TaskContext); // Use TaskContext

  const [columns, setColumns] = useState({
    todo: {
      id: uuidv4(),
      title: 'ToDo',
      items: [
        { id: uuidv4(), content: 'Task 1', column: 'todo' } // Modify task structure to include column
      ]
    },
    inProgress: {
      id: uuidv4(),
      title: 'InProgress',
      items: []
    },
    completed: {
      id: uuidv4(),
      title: 'Completed',
      items: []
    },
    delayed: {
      id: uuidv4(),
      title: 'Delayed',
      items: []
    }
  });

  useEffect(() => {
    // Update TaskContext with column IDs
    const updatedColumnIds = Object.keys(columns).map(key => columns[key].id);
    setColumnIds(updatedColumnIds);
  }, [columns, setColumnIds]);

  const onDragEnd = result => {
    const { destination, source } = result;

    // If the item is dropped outside a droppable area, do nothing
    if (!destination) return;

    const newColumns = { ...columns };

    // If the item is dropped into a different column
    if (source.droppableId !== destination.droppableId) {
      const sourceColumn = newColumns[source.droppableId];
      const destColumn = newColumns[destination.droppableId];

      // Ensure both source and destination columns are defined
      if (!sourceColumn || !destColumn) {
        console.error('Invalid source or destination column');
        return;
      }

      // Get the source and destination items
      const sourceItems = [...sourceColumn.items];
      const destItems = [...destColumn.items];

      // Remove the item from the source column
      const [removed] = sourceItems.splice(source.index, 1);

      // Insert the item into the destination column
      destItems.splice(destination.index, 0, { ...removed, column: destination.droppableId });

      // Update the columns state
      setColumns({
        ...columns,
        [source.droppableId]: {
          ...sourceColumn,
          items: sourceItems
        },
        [destination.droppableId]: {
          ...destColumn,
          items: destItems
        }
      });
    } else { // If the item is dropped within the same column
      const column = newColumns[source.droppableId];

      // Ensure the column is defined
      if (!column) {
        console.error('Invalid column');
        return;
      }

      const copiedItems = [...column.items];

      // Remove the item from its original position
      const [removed] = copiedItems.splice(source.index, 1);

      // Insert the item into the new position
      copiedItems.splice(destination.index, 0, removed);

      // Update the columns state
      setColumns({
        ...columns,
        [source.droppableId]: {
          ...column,
          items: copiedItems
        }
      });
    }
  };

  return (
    <DragDropContext onDragEnd={onDragEnd}>
      <div className="dashboard">
        <aside className="sidebar">
          <h2>Upcoming Events</h2>
          <EventCard />
        </aside>
        <div className="main-section">
          <main className="main-content" style={{ height: "fit-content", width: "100%" }}>
            <h1>Main Content</h1>
            <p>This is the main content area of the dashboard.</p>
          </main>
          <div style={{ display: 'flex' }}>
            {columnIds.map((columnId) => (
              <div key={columnId} style={{ margin: '8px', minHeight: '200px' }}>
                <h2>{columnId}</h2>
                <Droppable droppableId={columnId}>
                  {(provided) => (
                    <div ref={provided.innerRef} {...provided.droppableProps} style={{ backgroundColor: 'lightgrey' }}>
                      {columns[columnId].items.map((item, index) => (
                        <Draggable key={item.id} draggableId={item.id} index={index}>
                          {(provided) => (
                            <div
                              ref={provided.innerRef}
                              {...provided.draggableProps}
                              {...provided.dragHandleProps}
                            >
                              <Task task={item} />
                            </div>
                          )}
                        </Draggable>
                      ))}
                      {provided.placeholder}
                    </div>
                  )}
                </Droppable>
              </div>
            ))}
          </div>
        </div>
      </div>
    </DragDropContext>
  );
};

export default Dashboard;
